DROP DATABASE IF EXISTS highrisk;
CREATE DATABASE highRisk;

USE highrisk;

CREATE TABLE `highRiskCountires` (
    `TransactionID`	VARCHAR(512),
    `CustomerID`	VARCHAR(512),
    `Amount`	INT,
    `Currency`	VARCHAR(512),
    `SourceCountry`	VARCHAR(512),
    `DestinationCountry`	VARCHAR(512),
    `Date`	DATE,
    PRIMARY KEY (`TransactionID`)
);


